function getUserData() {
    fetch(`/user_view/`, {
        method: 'POST',
        headers: {},
        body: JSON.stringify({'data': 'myData'})
    })
        .then(response => response.json())
        .then(data => {
            console.log(data)
        })
}

function getDishData() {
    fetch(`/user_view/`, {
        method: 'POST',
        headers: {},
        body: JSON.stringify({'data': 'myData'})
    })
        .then(response => response.json())
        .then(data => {
            console.log(data)
        })
}

export default getUserData
